import React from "react";
import { Bar } from "react-chartjs-2";

function Chart({ data }) {
  const topTen = data
    .sort((a, b) => {
      return a.donate < b.donate ? 1 : -1;
    })
        .slice(0, 10);
    
    ////////////////////////////////BAR ChArt////////////////////////////////////////
    
    
    
    

  return (
    <div>
      CHart
      <ul>
        {data &&
          topTen.map((list) => {
            return <li key={list.id}>{list.donate}</li>;
          })}
      </ul>
    </div>
  );
}

export default Chart;
